package com.datatypes;

public class Typecasting {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i=30;
		long j=i;
		System.out.println(j);
		int h=40;
		double d=h;
		System.out.println(d);
		double num=45.0009;
		int k=(int)num;
		System.out.println(k);

	}

}
